import "./DhondtPollingStation.sol";
  
contract Election {
    address public authority; // [cite: 78]
    uint public numParties;
    
    mapping(uint => DhondtPollingStation) public stations; // ID Region => Contrato Sede
    mapping(address => bool) public hasVoted; // Registro de votantes [cite: 77]

    modifier onlyAuthority() {
        require(msg.sender == authority, "Solo la autoridad puede hacer esto"); // [cite: 82]
        _;
    }

    constructor(uint _numParties) {
        authority = msg.sender; // [cite: 88]
        numParties = _numParties; // [cite: 87]
    }

    function createPollingStation(uint _regionId, address _president) external onlyAuthority {
        require(address(stations[_regionId]) == address(0), "Ya existe sede en esta region"); // [cite: 83, 90]
        
        // Creamos una nueva instancia del contrato Sede [cite: 90]
        DhondtPollingStation newStation = new DhondtPollingStation(_president, numParties, _regionId);
        stations[_regionId] = newStation;
    }

    function castVote(uint _regionId, uint _partyId) external {
        require(address(stations[_regionId]) != address(0), "Sede no valida"); // [cite: 85, 94]
        require(!hasVoted[msg.sender], "Ya has votado"); // [cite: 94]

        hasVoted[msg.sender] = true;
        stations[_regionId].castVote(_partyId); // Llama a la sede correspondiente [cite: 95]
    }

    function getResults() external view onlyAuthority returns (uint[] memory) {
        uint[] memory totalResults = new uint[](numParties);
        
        // En una practica real usariamos un array de IDs para recorrer las sedes [cite: 97]
        // Suponiendo que conocemos las regiones (ej: Madrid 28 y Teruel 44 del PDF) [cite: 108]
        uint[2] memory regions = [uint(28), 44]; 

        for (uint i = 0; i < regions.length; i++) {
            uint[] memory stationRes = stations[regions[i]].getResults(); // [cite: 97]
            for (uint j = 0; j < numParties; j++) {
                totalResults[j] += stationRes[j]; // Consolidacion [cite: 99]
            }
        }
        return totalResults;
    }
}

lab3/DhondtPollingStation.sol.content:
import "./DhondtElectionRegion.sol";
import "./PollingStation.sol";

contract DhondtPollingStation is PollingStation, DhondtElectionRegion {
    
    // 1. Añadimos la variable para guardar la dirección de la autoridad
    address private creador;

    constructor(address _president, uint _numParties, uint _regionId) 
        PollingStation(_president) 
        DhondtElectionRegion(_numParties, _regionId) 
    {
        // 2. Asignamos quién es la autoridad (el que despliega el contrato)
        creador = msg.sender; 
    }

    // 3. Añadimos el modificador según tu captura de pantalla
    modifier onlyAuthority() {
        require(msg.sender == creador, "error no autorizado"); 
        _;
    }

    function castVote(uint _partyId) external override onlyIfOpen {
        bool success = registerVote(_partyId); 
        if (!success) revert("Identificador de partido no valido");
    }

    // 4. Aplicamos el modificador 'onlyAuthority' a la función de resultados
    function getResults() external view override onlyAuthority returns (uint[] memory) {
        if (!votingFinished) revert("La votacion aun no ha terminado"); 
        return results; 
    }
}

lab3/PollingStation.sol.content:
abstract contract PollingStation {
    address public president; // [cite: 51]
    bool public votingFinished = false; // [cite: 46]
    bool private votingOpen = false; // [cite: 47]

    modifier onlyPresident() {
        require(msg.sender == president, "Solo el presidente puede hacer esto"); // [cite: 62]
        _;
    }

    modifier onlyIfOpen() {
        require(votingOpen && !votingFinished, "La votacion no esta abierta"); // [cite: 55, 60]
        _;
    }

    constructor(address _president) {
        president = _president; // [cite: 53]
    }

    function openVoting() external onlyPresident {
        require(!votingFinished, "La votacion ya finalizo");
        votingOpen = true; // [cite: 54]
    }

    function closeVoting() external onlyPresident {
        votingOpen = false;
        votingFinished = true; // [cite: 56, 57]
    }

    // Funciones que implementara el hijo [cite: 58]
    function castVote(uint _partyId) external virtual;
    function getResults() external virtual returns (uint[] memory);
}

